export default <style>{`
body{
    margin;10px;
}
hl{
    font-size:68pt;
    font-weight:bold;
    text-align:right;
    letter-spacing:-8px;
    color:#f0f0f0;
    margin:-32px 0px;
}
p{
    margin:0px;
    color:#666;
    font-size:16pt;
}
`}</style>;
